import React from 'react';

import styles from './LaunchItem.module.scss';

export default function LaunchItem({ flight }) {
  console.log(flight);
  return (
    <div className={styles.card}>
      <div>
        <h3 className={styles.h3}>Flight No. {flight.flight_number}</h3>
        <h4 className='text-left'>Mission: {flight.name}</h4>
      </div>

      <button className='button_primary'>Launch Details</button>
    </div>
  );
}
